import React from 'react';
import ReactDOM from 'react-dom';

import {
  Route,
  NavLink,
  BrowserRouter
} from "react-router-dom";

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import TestComponent from './test_page.js';
import TestComponent2 from './test_page2.js';
import TestComponent3 from './test_page3.js';

function App() {
  return (
    <div className="App">
      <BrowserRouter basename = "/">
        <Navbar expand="lg" style={{backgroundImage:"linear-gradient(to right, #ff0000 30%, #0000ff)"}} sticky='top'>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav>
            <Nav.Link style={{color:"white"}} to="/" href="/">ACP</Nav.Link>
            <Nav.Link style={{color:"white"}} to="/about" href="/about">About</Nav.Link>
            <Nav.Link style={{color:"white"}} to="/contact" href="/contact">Contact</Nav.Link>
          </Nav>
        </Navbar.Collapse>
        </Navbar>

        <Route exact path="/" component={TestComponent} />
        <Route path="/about" component={TestComponent2} />
        <Route path="/contact" component={TestComponent3} />
      </BrowserRouter>
    </div>
  );
}

export default App;
